“Macao Maritime Info” is an application, developed by the Marine and Water Bureau of the Macao SAR, which aims to provide maritime information for citizens and tourists via mobile devices. Its main features include:
• Real time sailings – provide information on real time arriving and departing sailings at all ferry terminals;
• Sailing schedule – provide regular sailing schedules of all ferry routes;
• Real time sea conditions - provide camera views showing real time sea conditions in different areas;
• Tides – provide real time tidal heights and allow users to search for predicted tidal heights;
• Notice to mariners – provide the latest navigation information for vessels;
Services at terminals – provide information on shops, ticket office, restaurants and services available in the terminals.

‘WH Macau’ is a mobile application launched by the Cultural Affairs Bureau of the Macao SAR. The app creates the effect of “Strolling through the Historic Centre of Macao” by providing detailed descriptions of World Heritage sites, interesting multi-media information (short video clips, photographs, 360-degree views, activities related to the locale, etc.) and various interactive functions (a route guide linking the Heritage sites, Facebook functionality, etc.). Users will gain a much more comprehensive understanding of the Historic Centre of Macao and its World Heritage sites. 

Features 

The app provides comprehensive and detailed information: 

•An introduction to Macao World Heritage; 
•Locations and a recommended route through the Historic Centre of Macao; 
•An introduction to the various World Heritage sites with details including opening hours, addresses and street views; 
•Information about the current activities being held at the World Heritage sites; 
•News related to Macao World Heritage; 
•Full 360-degree views of World Heritage sites; 
•Beautiful images of Macao World Heritage; 
•Promotional video clips about Macao World Heritage; 
•Useful Macao phone numbers. 

Route Guide 

•Users may link this app with Maps and/or GPS (Global Positioning System) to establish their current location, distance from, and directions to the various World Heritage sites. 

Share Function 

•Users may recommend the World Heritage sites and experiences from their visit to friends at home and abroad by “Sharing” on Facebook. 

Browsing Mode 

•The app provides both online and offline modes. The online mode provides users with the most up-to-date news and information about activities and allows them to use the route guide and share function, while the offline mode provides users with extensive information about the World Heritage sites and various other spots in Macao. 


Language 

•The app offers screenshots and information in Traditional Chinese, Simplified Chinese, English and Portuguese. Users may choose their preferred language in the settings.

This app creates a declaration for Declaration of Personal Effects and Unaccompanied Articles that is submitted to Customs upon entry into Japan. You can electronically submit the declarations drafted by this app in lieu of previous paper-based declarations at an electronic declaration terminal installed at the customs inspection area at airport terminals listed below. Once you have downloaded this app, you can create declarations any time, and as many times as you need to offline, so this app is convenient if you download it before departure. 

[Airport Terminals Where Electronic Declaration Terminals are Available]
 *Please refer to the website of Japan Customs for the start date.
  Narita International Airport;
  Haneda Airport (Tokyo International Airport);
  Kansai International Airport;
  Chubu Centrair International Airport;
  Fukuoka Airport;
  New Chitose Airport; and
  Naha Airport;
